import Nam1 from "./image/anh1.jpg";
import Nam2 from "./image/anh2.jpg";

import cafe from "./asset/cafe.jpg";
import cafe2 from "./asset/cafe2.png";

function App() {
  return (
    <div className="bg-[#191818] h-screen ">
      <Component2 />
    </div>
  );
}

const Component2 = () => {
  return (
    <div
      className=" bg-center bg-cover px-96  flex flex-col justify-center items-center "
      style={{
        backgroundImage: `url(${cafe})`,
        width: "100%", // Chiều rộng tối đa theo ảnh
        height: 1000, // Điều chỉnh chiều cao tùy ý (có thể thay bằng auto)
      }}
    >
      <div className="text-white bg-red-200">Trụ sở Viettel</div>
      <div className="text-white bg-red-200">06 | 01 | 2025</div>
      <div>
        <img alt="cafe" src={cafe2} className="bg-center bg-cover" />
      </div>
      <div className="text-white bg-red-200">
        Đến với Viettel&You 2025, khách mời sẽ được bước vào một hành trình đặc
        biệt, nơi mỗi hạt cà phê Việt Nam được tôn vinh qua từng giai đoạn: từ
        những nương cà phê bạt ngàn của cao nguyên Lâm Đồng, quy trình rang xay
        tinh tế, cho đến tách cà phê hoàn mỹ trên tay. Đây không chỉ là trải
        nghiệm thưởng thức mà còn là dịp để khám phá câu chuyện văn hóa cà phê
        Việt – một di sản kết nối truyền thống và hiện đại.
      </div>
      <div>
        Khách mời sẽ được tận mắt chứng kiến quy trình rang xay cà phê – một
        nghệ thuật đòi hỏi sự tỉ mỉ và am hiểu sâu sắc về hạt cà phê. Từng giai
        đoạn, từ việc lựa chọn nguyên liệu đến cách rang để tạo ra hương thơm
        đặc trưng, đều mang trong mình câu chuyện của người nông dân và nghệ
        nhân cà phê Việt. Đỉnh cao của hành trình là khi bạn được thưởng thức
        tách cà phê được pha chế bởi chính Barista Trần Quế Hân, người thổi hồn
        vào từng giọt cà phê, biến chúng thành những tác phẩm nghệ thuật.
      </div>
    </div>
  );
};

const Anh1 = () => {
  return (
    <div
      className=" bg-center bg-cover"
      style={{
        backgroundImage: `url(${Nam1})`,
        width: "100%", // Chiều rộng tối đa theo ảnh
        height: 1000, // Điều chỉnh chiều cao tùy ý (có thể thay bằng auto)
      }}
    ></div>
  );
};

const Anh2 = () => {
  return (
    <div
      className="bg-center bg-cover "
      style={{
        backgroundImage: `url(${Nam2})`,
        width: "100%", // Điều chỉnh chiều rộng theo ý muốn
        height: 300,
        backgroundColor: "red",
        // Điều chỉnh chiều cao
      }}
    ></div>
  );
};

export default App;
